//knottscolonialfuneralhome.com/tribute/details/347/Roberto-Berrios/obituary.html","other_link":"","blurb_optional":"Roberto was a happy, hardworking and loving man. He would give the shirt off his back to help anyone. He is loved and missed every day by his wife, children and grandchildren. ","id":"roberto-berrios"},{"name_display":"Robert Brennan Jr.","name_sort":"Brennan Jr., Robert","county":"Mercer","age":"","photo_optional":"","profile_link":"","obit_link":"https://obits.nj.com/obituaries/trenton/obituary.aspx?n=robert-brennan&pid=197370509&fhid=27069","other_link":"https://twitter.com/GovMurphy/status/1377311360980238342?s=20","id":"robert-brennan-jr"},{"name_display":"Mario Casale, Sr.","name_sort":"Casale, Mario Sr.","county":"Mercer","age":"90","photo_optional":"","profile_link":"","obit_link":"http://www.brennafuneralhome.com/obituary/mario-casale-sr","other_link":"","blurb_optional":"\\"My father was very special to me, he would do anything for his family.  He treated his children fairly and above all loved us with his entire heart.  I will miss him everyday of my life. COVID took him from us - but the memories, stories and love will last a lifetime.\\" \u2014Alicia Graziano","id":"mario-casale-sr"},{"name_display":"Carolyn Wilcox Coleman","name_sort":"Coleman, Carolyn Wilcox","county":"Mercer","age":"","photo_optional":"","profile_link":"","obit_link":"https://obits.nj.com/obituaries/trenton/obituary.aspx?n=carolyn-h-wilcox-coleman&pid=196211061&fhid=13302","id":"carolyn-wilcox-coleman"},{"name_display":"Arlene Conover","name_sort":"Conover, Arlene","county":"Mercer","age":"72","photo_optional":"","profile_link":"","obit_link":"http://www.brennafuneralhome.com/obituary/arlene-conover","id":"arlene-conover"},{"name_display":"MaryAnn Delorme","name_sort":"Delorme, MaryAnn","county":"Mercer","age":"78","photo_optional":"","profile_link":"","obit_link":"https://knottscolonialfuneralhome.com/tribute/details/418/Maryann-Delorme/obituary.html#tribute-start","i